import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../styles/Dashboard.css';

const Dashboard = ({ user }) => {
  const [books, setBooks] = useState([]);
  const [contests, setContests] = useState([]);
  const [performance, setPerformance] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const booksResponse = await axios.post('http://3.6.229.61:9089/v1/get_book_details', {
          class_id: user.user_grade,
          user_id: user.user_id,
          board: 'CBSC',
        });
        setBooks(booksResponse.data.data);

        const contestsResponse = await axios.post('http://3.6.229.61:9089/v1/launch', {
          user_id: user.user_mobile,
        });
        setContests(contestsResponse.data.data);

        const performanceResponse = await axios.post('http://3.6.229.61:9089/v1/get_performance', {
          user_id: user.user_mobile,
        });
        setPerformance(performanceResponse.data.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };
    fetchData();
  }, [user]);

  return (
    <div className="dashboard-container">
      <img src="/assets/tee-scholar-logo.png" alt="Tee Scholar" className="logo" />
      <div className="welcome-text">Welcome {user.user_name}</div>

      {/* Books Section */}
      <div className="books-section">
        <h3>Books</h3>
        {books.length > 0 ? (
          books.map((book) => <p key={book.id}>{book.title}</p>)
        ) : (
          <p>No books available</p>
        )}
      </div>

      <div className="dashboard-grid">
        <div className="card study-card">
          <img src="/assets/grad-cap.png" alt="Study Icon" />
          <h3>Study</h3>
          <p>Access curriculum-specific resources and ask questions.</p>
        </div>
        <div className="card test-card">
          <img src="/assets/book.png" alt="Test Icon" />
          <h3>Test</h3>
          <p>Prepare for exams with practice tests.</p>
          <span className="new-label">New!</span>
        </div>
        <div className="card performance-card">
          <img src="/assets/lightbulb.png" alt="Performance Icon" />
          <h3>Performance</h3>
          <p>Track and analyze your learning progress.</p>
        </div>
        <div className="card pdf-card">
          <img src="/assets/paper-plane.png" alt="Upload PDF Icon" />
          <h3>Upload PDF</h3>
          <p>Submit and access your study materials.</p>
        </div>
        <div className="card image-card">
          <img src="/assets/backpack.png" alt="Image Upload Icon" />
          <h3>Image Upload</h3>
          <p>Upload images for assignments or reference.</p>
        </div>
        <div className="card chat-card">
          <img src="/assets/paper-plane.png" alt="Chat History Icon" />
          <h3>Chat History</h3>
          <p>Review previous discussions and interactions.</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
